import TaskDictionary from "./../../utility/TaskDictionary"; 
import Task from "./../TaskComp/TaskComp"; 
import {useState} from 'react'; 


export default function RightTaskBar() {

    let [date, setDate] = useState(TaskDictionary.convertDate(new Date(Date.now()))); 

    let taskList = TaskDictionary.getTasks(parseInt(date)); 

    if(taskList == null) return ( <p id="taskbar-title"> {TaskDictionary.revertDate(date).toString().substring(0, 14)} </p>); 
    return (
        // Refers to TaskComp, not utility class. Utility class not directly needed in this context

        <div>
            <p id="taskbar-title"></p>

            <table>
                <Task task = {taskList[0]}></Task>
                <Task task = {taskList[1]}></Task>
                <Task task = {taskList[2]}></Task>
                <Task task = {taskList[3]}></Task>
                <Task task = {taskList[4]}></Task>
                <Task task = {taskList[5]}></Task>
                <Task task = {taskList[6]}></Task>
                <Task task = {taskList[7]}></Task>
                <Task task = {taskList[8]}></Task>
                <Task task = {taskList[9]}></Task>
                <button id="add-task"></button>
            </table>
        </div>
    );





}
